import React from "react";
import PageLayout from "src/Layouts/PageLayout";

const Work = () => {
  return (
    <PageLayout>
      <main className="flex flex-col flex-grow gap-20 px-32 mx-10 mb-10 border-x-2 border-black overflow-auto">
        <h4 className="grid py-20 text-8xl tracking-wider font-medium border-b border-black">
          Uno.ai
        </h4>

        <p>
          A compound AI system to radically transform your GRC program from
          tedious, cumbersome, and time taking workflows to a fast and scalable
          AI native reality. Uno's domain specific compound AI system scales and
          outperforms generic language models to deliver the accuracy,
          resiliency, scale, speed, and assurance that enterprises need.
        </p>
      </main>
    </PageLayout>
  );
};

export default Work;
